import React from 'react';
import { Navbar, Nav, NavDropdown, Form, FormControl, Button } from 'react-bootstrap';
import SearchComponent from '../containers/Search'

function Navbars() {
  return (
    <div className="sticky">

      <Navbar className="color-nav" bg="color-nav" expand="lg" >

        {$(document).ready(function(){
	$('#nav-icon1,#nav-icon2,#nav-icon3,#nav-icon4').click(function(){
		$(this).toggleClass('open');
	});
})}
        <Navbar.Brand href="/"> <img
          src="https://upload.wikimedia.org/wikipedia/commons/thumb/6/69/IMDB_Logo_2016.svg/1200px-IMDB_Logo_2016.svg.png"
          width="70"
          height="30"
          className="d-inline-block align-top"
          alt="React Bootstrap logo"
        /></Navbar.Brand>
        <Nav.Link href="#link">WATCHLIST</Nav.Link>
        <SearchComponent type="text" placeholder="Search" className="mr-sm-2" />


        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">

          <Form inline>


          </Form>

        </Navbar.Collapse>
        <Nav className="mr-auto">

          <NavDropdown title="INGRESAR" id="basic-nav-dropdown">

            <NavDropdown.Item href="#action/3.1">Sign In</NavDropdown.Item>

            <NavDropdown.Item href="#action/3.2">Log In</NavDropdown.Item>

            <NavDropdown.Divider />
          </NavDropdown>
        </Nav>
      </Navbar>

    </div>
  )
}

export default Navbars;
